import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const Profile = () => {
  return (
    <Container>
      <Row>
        <Col>
          <h1>Profile Page</h1>
        </Col>
      </Row>
    </Container>
  );
};

export default Profile;
